// EventList.js

import React from 'react';

const EventList = ({ events, onSelect }) => {
  return (
    <div className="event-list">
      <h2>All Events</h2>
      {events.map(event => (
        <div key={event.id} className="event-card">
          <div><strong>Name:</strong> {event.event_name}</div>
          <div><strong>Category:</strong> {event.event_category}</div>
          <div><strong>Timings:</strong> {event.start_time} - {event.end_time}</div>
          <button onClick={() => onSelect(event)}>Select</button>
        </div>
      ))}
    </div>
  );
};

export default EventList;
